import React, { Component } from 'react';
import './App.css';
import Card from './card';

class AdminHome extends Component {
    constructor(props){
      super(props);
      this.state={
        loading: true
      }
    }

    render() {
      return (
        <div className="App">
        <center>
        <Card />
        </center>

        </div>
      );
    }
  }

  export default AdminHome;
